 * eventData.input - current state of input link (string)
 * eventData.ch0 - current state of channel0. (Object. Members {channel}, {date}, {value})
 * eventData.ch1 - current state of channel1. (Object. Members {channel}, {date}, {value})
 * eventData.inputCh - current state of channel being processed and the channel details (Object. Members {channel}, {value})
 * eventData.matchingCh all channels that have any match to part of the processed channel (Object. Members {channel}, {value})
 * @return {string} return a value to continue the flow or to cancel flow return null
 */
var reverseKey = "AIzaSyDJnu5eo1S9Fbqygj6FcFc8HkPEKcIrw4E";

Script.on("flow", function(eventData) {
    var packet = JSON.parse(eventData.input);
    var serNo = packet.SerNo;
    var records = packet.Records; // Returns an array
    var seen = new Date(0);
    var latestLat;
    var latestLng;
    var latestTemp;
    var latestSignal;
    var triggered = System.getChannelValue("SENSAHUB/KG/BRISBANE/" + serNo + "/ACTIVATED");
    //console.log("========================> " + triggered);
    var triggeredTime = -1;
    var latestBattery;
    var updateAddress = false;
    var debug = 3;

    for (var p of records) {
        var reason = p.Reason;
        var date = new Date(p.DateUTC);

        var lat;
        var lng;
        var temp;
        var signal;
        var battery;

        var fields = p.Fields;
        for (f of fields) {
            switch (f.FType) {
                case 0:
                    lat = f.Lat;
                    lng = f.Long;
                    break;
                case 6:
                    var ad = f.AnalogueData;
                    temp = Math.round(ad["3"] / 100);

                    // Calc signal
                    signal = parseInt(ad["4"]);

                    // Calc battery
                    battery = ad["1"] / 1000;

                    if (battery > 4.8) {
                        battery = 4;
                    } else if (battery > 4.65) {
                        battery = 3;
                    } else if (battery > 4.5) {
                        battery = 2;
                    } else {
                        battery = 1;
                    }
            }
        }

        // Update last seen time and update location
        if (date > seen) {
            seen = date;
            latestLat = lat;
            latestLng = lng;
            latestTemp = temp;
            latestSignal = signal;
            latestBattery = battery;
        }

        // Set activated otherwise
        if (reason == 46 && triggered == 1) {
            triggered = 2;
            triggeredTime = date.getTime();
            updateAddress = true;
        } else if (reason == 2) {
            updateAddress = true;
        }
    }

    var finalObj = {
        date: seen.getTime(),
        Lat: latestLat,
        Lng: latestLng,
        Temp: latestTemp,
        Battery: latestBattery,
        Signal: latestSignal,
        Triggered: triggered,
        TriggeredTime: triggeredTime,
        reason: ""
    };

    if (updateAddress) {
    //if (true) {
        var url="https://maps.googleapis.com/maps/api/geocode/json?latlng=" + finalObj.Lat + "," + finalObj.Lng + "&key=" + reverseKey;
        finalObj.reason = url;
    }

    return JSON.stringify(finalObj);
});

